// ==UserScript==
// @name         超级视频倍速播放
// @namespace    https://greasyfork.org/zh-CN/scripts/480875
// @icon         data:image/gif;base64,
// @version      2.1
// @author       wll
// @description  视频倍速播放超级版：默认快捷键：‘x’, ‘c’, ‘z’ ① x: 加速0.1 ② c: 减速0.1 ③ z: 复位 1.0
// @match        *://*/*
// @run-at       document-end
// @grant        GM_getValue
// @grant        GM_setValue
// @license      GPL-3.0-or-later
// @downloadURL  https://update.greasyfork.org/scripts/480875/%E8%B6%85%E7%BA%A7%E8%A7%86%E9%A2%91%E5%80%8D%E9%80%9F%E6%92%AD%E6%94%BE.user.js
// @updateURL    https://update.greasyfork.org/scripts/480875/%E8%B6%85%E7%BA%A7%E8%A7%86%E9%A2%91%E5%80%8D%E9%80%9F%E6%92%AD%E6%94%BE.meta.js
// ==/UserScript==

(function () {
    'use strict';

    const messages = {
        'zh': {
            'speedText': '当前速度：',
            'speedChanged': '当前速度：'
        },
        'en': {
            'speedText': 'Current Speed: ',
            'speedChanged': 'Current speed：'
        }
    };
    const curLang = navigator.language.slice(0, 2);
    const MSG = messages[curLang] || messages.en;

    function checkExistVideo() {
        let videos = document.querySelectorAll("video");
        if (videos.length > 0) {
            return true;
        } else {
            return false;
        }
    }

    function checkInIframe(){
        if (window.self !== window.top) {
            return true;
        }else{
            return false;
        }
    }

    function saveHostName(key, val) {
        let hostname = "";
        if (checkInIframe()) {
            hostname = new URL(window.parent.location.href).hostname;
        } else {
            hostname = new URL(window.location.href).hostname;
        }
        let saveKV = window.GM_getValue(hostname) || {};
        saveKV[key] = val;
        window.GM_setValue(hostname, saveKV);
    }

    function getHostName(key) {
        let hostname = "";
        if (checkInIframe()) {
            hostname = new URL(window.parent.location.href).hostname;
        } else {
            hostname = new URL(window.location.href).hostname;
        }
        const saveKV = window.GM_getValue(hostname);
        if (saveKV && saveKV[key]) {
            return saveKV[key];
        } else {
            return null;
        }
    }

    let playbackRate = parseFloat(getHostName('playbackRate')) || 1;

    // 创建消息提示元素
    function showMsg(msgText) {
        let messageElement = document.createElement('div');
        messageElement.style.position = 'absolute';
        messageElement.style.top = '10px';
        messageElement.style.left = '10px';
        messageElement.style.padding = '10px';
        messageElement.style.backgroundColor = '#333';
        messageElement.style.color = 'white';
        messageElement.style.borderRadius = '5px';
        messageElement.style.opacity = '0.9';
        messageElement.style.transition = 'opacity 0.5s ease';
        messageElement.style.zIndex = '2147483647';
        messageElement.style.fontSize = '16px';
        messageElement.style.fontFamily = 'Arial, sans-serif';
        messageElement.innerText = msgText;

        try {
            document.querySelector('video').parentNode.appendChild(messageElement);
        }catch (e) {
            document.body.appendChild(messageElement);
        }finally {
            setTimeout(function () {
                messageElement.remove();
            }, 1000);
        }
    }

    const changeSpeed = (newSpeed) => {
        const videos = document.querySelectorAll('video');

        videos.forEach((video) => {
            video.playbackRate = newSpeed.toFixed(1);
        });

        playbackRate = newSpeed;
        saveHostName('playbackRate', newSpeed);
        showMsg(MSG.speedText + newSpeed.toFixed(1));
    };

    const handleKeyPress = (event) => {
        if (!checkExistVideo()){return;}

        const {key} = event;
        if (key === 'x') {
            changeSpeed(Math.max(playbackRate - 0.1, 0.1));
        } else if (key === 'c') {
            changeSpeed(Math.min(playbackRate + 0.1, 20));
        } else if (key === 'z') {
            changeSpeed(1);
        }
    };
    document.addEventListener('keydown', handleKeyPress);

    const handleIframeMessage = (event) => {
        if (!checkExistVideo()){return;}

        const {data} = event;
        if (data && data.type === 'changeSpeed' && typeof data.speed === 'number') {
            changeSpeed(data.speed);
        }
    };
    window.addEventListener('message', handleIframeMessage);

    if (checkInIframe()) {
        window.parent.postMessage({type: 'changeSpeed', speed: playbackRate,}, '*');
    }

    window.onload = function () {
        const videos = document.querySelectorAll('video');
        videos.forEach((video) => {
            video.playbackRate = playbackRate.toFixed(1);
        });
    }

})();